import React from 'react';
import './home.css';
import Title from './Title.js';
import ProfileImage from './ProfileImage.js';

const Home = () => {
  const createBackgroundBubbles = () => {
    const bubbles = [];
    let marginValue = 0;
    for (let i = 0; i < 300; i++) {
      marginValue = marginValue + 1;
      bubbles.push(React.createElement('div', {className:'bubbles', style:{margin: `0 ${marginValue}vw`}, key:i}));
    }
    return bubbles;
  }

  return (
    <div className='home'>
      <div className='backgroundContainer'>
        {createBackgroundBubbles()}
      </div>
      <ProfileImage />
      <Title />
    </div>
  );
}

export default Home;
